const db = {
    getAll: () => database,
    
    getById: (id) => database.products.find(item => item.id === id),
    
    getCategories: () => database.categories,
    
    getProductsByCategory: (categoryId) => {
        const category = database.categories.find(cat => cat.id === categoryId);
        if (!category) return [];
        return database.products
            .filter(product => category.products.includes(product.id))
            .map(product => ({
                ...product,
                image: product.images[0]
            }));
    },

    getProductsBySubcategory: (categoryId, subcategoryId) => {
        const category = database.categories.find(cat => cat.id === categoryId);
        if (!category || !category.subcategories) return [];
        const subcategory = category.subcategories.find(sub => sub.id === subcategoryId);
        if (!subcategory) return [];
        return database.products
            .filter(product => subcategory.products.includes(product.id))
            .map(product => ({
                ...product,
                image: product.images[0]
            }));
    },

    getAllProducts: () => {
        return database.products.map(product => ({
            id: product.id,
            name: product.name,
            description: product.description,
            image: product.images[0]
        }));
    }
};

